import React from "react";
import TableCell from "@material-ui/core/TableCell";
import TableRow from "@material-ui/core/TableRow";
import {Link} from "react-router-dom";
import {selectEmployee} from "../redux/reducerE";

const Employee = ({id, fullName, bDay}, ...props) => {

    let onEmployeeSelected = (id) => {
        console.log(selectEmployee)
        props.selectEmployee(id);
    }

    return (
        <TableRow>
            <TableCell>{id}</TableCell>
            <TableCell> <Link onClick={onEmployeeSelected} to="/worktime">{fullName}</Link> </TableCell>
            <TableCell>{bDay}</TableCell>
        </TableRow>
    )
};

export default Employee;
